import styled from 'styled-components';

export const Navbar = styled.div`
    background-color: grey;
    overflow: hidden;
    position: fixed;
    right: 0;
    width: 10%;
    height: 100%;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    `;
